import React from 'react';
import './signinpage.css';

class signinpage extends React.Component {

	constructor() {
	  super()
	  this.state={
	    signInEmail: '',
	    signInPassword: ''
	  }
	}

	render() {
		const {onRouteChange} = this.props;
		return (
		    <div className="App">
		      <div className='signinform'>
		        <input className='glassmorph inputbox' type='text' placeholder='Username'/><br/>
		        <input className='glassmorph inputbox' type='text' placeholder='Password'/><br/>
		        <button type='button' className='glassmorph signinBtn' onClick={() => onRouteChange('main')}>Sign In</button><br/>
		      </div>
		    </div>
	    )
	}
}



